import React from 'react';
import styled from 'styled-components';

const Card = styled.div`
  border: 1px solid #e1e1e1;
  border-radius: 10px;
//   overflow: hidden;
  width: 200px;
  box-shadow: 0 2px 8px rgba(0, 0, 0, 0.1);
`;

const Image = styled.img`
  width: 100%;
  height: 150px;
  object-fit: cover;
`;

const Content = styled.div`
  padding: 15px;
  text-align: center;
`;

const Price = styled.div`
  margin: 10px 0;
  font-size: 18px;
  font-weight: bold;
`;

const OldPrice = styled.span`
  text-decoration: line-through;
  color: #888;
  margin-left: 5px;
`;

const Rating = styled.div`
  margin: 10px 0;
  font-size: 14px;
`;

const ProductName = styled.div`
  font-size: 16px;
  font-weight: 500;
  margin: 10px 0;
`;

const BuyButton = styled.button
    ` background: #4285f4;
  color: white;
  border: none;
  border-radius: 5px;
  padding: 10px 20px;
  cursor: pointer;
  font-size: 14px;

  &:hover {
    background: #357ae8;
  }`;
